import React, { Component } from 'react';

class MyComponent extends Component {
    static defaultProbs = {
        name: '기본이름'
    }
    render() {
        return (
            <div>
            안녕하세요, 제 이름은 {this.props.name} 입니다
            </div>
        )
    }
}


export default MyComponent;
